script: |
  super -f text -I q2811.spq | sort > q2811.out

inputs:
  - name: q2811.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT - 83 * - 46 * col2 <= ( - col2 ) + - ( 11 ) + ( + col2 );
  - name: tab2

outputs:
  - name: q2811.out
    data: |
      46	51	23
      64	77	40
      75	67	58
